import React from 'react'
import Person from './Person'
import Button from './Button'

const PersonsDisplay = ({persons, deleteFunc}) => {

  return (
    <div>
      {persons.map((person) => <div><Person key={person.name} name={person.name} number={person.number}/> <Button clickFunc={deleteFunc(person.id)} description='delete'/></div> )}       
    </div>
  )
}


export default PersonsDisplay
